import React from 'react';

class ListItem extends React.Component {

    render() {
        return (
            <ul style={ rowStyle }>{ this.props.category }</ul>
        )
    }
}

const rowStyle = {
    backgroundColor: '#DADADA'
}

export default ListItem;
